      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE col2 + ( - col0 ) + + 78 + 18 + - col2 / - col0 NOT BETWEEN + col1 * + col2 AND - col1 * col1 * + 0 - + 94;
  - name: tab2

outputs:
  - name: q9454.out
    data: |
      46	51	23
      64	77	40
      75	67	58
